import '../../index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from '../../Components/Components-Header/Header_Component';
import TheLetterOfDeathComponent from '../../Components/Components-Comics/The-Letter-Of-Death-Components/TLOD-Component';
import Footer from '../../Components/Components-Footer/Footer-Component';
import BackToTopButton from '../../Components/Components-BackToTopButton/BackToTopButton-Component';
import { Component } from 'react';

function TLOD_page() {
    return (
      <div className='App'>
        <Header/>
        <TheLetterOfDeathComponent/>
        <Footer/>
        <BackToTopButton />
      </div>
    );
  }

  export default TLOD_page;
